import React, { Component } from 'react';
import './style.css';
import { Link } from 'react-router-dom';
import logoTunes from '../../images/logo-trybeTunes.png';
import { getUser } from '../../services/userAPI';

export default class Header extends Component {
  render() {
    const { name } = getUser.user;
    return (
      <div className="header-container">
        <header>
          <span>
            <Link to="/">
              <img src={ logoTunes } alt="Logo da TrybeTunes" />
            </Link>
          </span>
          <div>
            <p>{name || 'usuário'}</p>
          </div>
        </header>
        <nav>
          <h2><Link to="/search">Pesquisa</Link></h2>
          <h2><Link to="/favorites">Favoritas</Link></h2>
          <h2><Link to="/profile">Perfil</Link></h2>
        </nav>
      </div>
    );
  }
}
